## County

::: {.cell}

```{.sql .cell-code}
SELECT s.county, 
       round(SUM(rt.sales), 2) AS Total_Sales,
       round(SUM(rt.cost), 2) AS Total_Cost,
       round(SUM(rt.profit), 2) AS Total_Profit
  FROM revenue_tbl rt
  JOIN store s
  	ON rt.store_id = s.store_id
  GROUP BY s.county
  ORDER BY Total_Profit DESC;
```
